import React,{useState,useEffect} from 'react'
import Fetch from './Fetch'
import './Data.css'

function Data() {


const [data,setdata]=useState([])
const [first_name,set_first_name]=useState("")
const [last_name,set_last_name]=useState("")


useEffect(()=>{
    fetchdata()
},[])


async function fetchdata()
{
    await Fetch.getdata().then(res=>{
        setdata(res)
    })
    .catch((err)=>{console.log(err)})
}



function Editdata(e)
{
    alert(e.target.first_name)
}

  return (
    <div className='data'>
    
        <table>
        <tbody>
            <tr>

            <th>First Name</th>
            <th>Last Name</th>
            <th>Date</th>
            <th>Rank</th>
            <th>Gender</th>
            <th>Actions</th>
            </tr>

            {
                data?(data.map((val)=>(
                    <tr key={val._id}>
                        <td>{val.first_name}</td>
                        <td>{val.last_name}</td>
                        <td>{val.date.substring(0, 10).split('-').reverse().join('-')}</td>
                        <td>{val.rank}</td>
                        <td>{val.gender}</td>
                        <td><button style={{cursor:"pointer"}} onClick={Editdata}>EDIT</button>
                        <button>DELETE</button></td>
                    </tr>
                ))):<></>
            }
            </tbody>
        </table>

        <hr/>
        <input value={first_name}/>
        <input value={last_name}/>
        <button onClick={updateinfo}>Update</button>
    </div>
  )
}

export default Data
